import React from 'react';
import { StyleSheet, TextInput, Picker } from "react-native";
// import { Picker } from "react-native-web";
import './App.css';

function App() {
  const [selectedLanguage, setSelectedLanguage] = React.useState();

  return (
    <div className="App">
      <div className="App-page">
        <h1>ข้อมูลผู้ป่วย</h1>
        <p>
          <h1>เพศ</h1>
          <Picker style={styles.picker}>
            <Picker.Item label="ชาย" value="man" />
            <Picker.Item label="หญิง" value="woman" />
          </Picker>
        </p>
        <p>
          <h1>อายุ</h1>
          <TextInput
            style={styles.textinput}
            placeholder="อายุ"
          />
        </p>
        <p>
          <h1>อาชีพ</h1>
          <TextInput
            style={styles.textinput}
            placeholder="อาชีพ"
          />
        </p>
      </div>
    </div >
  );
}

const styles = StyleSheet.create({
  picker: {
    fontFamily: 'Prompt',
    fontSize: 20,
  },

  textinput: {
    fontFamily: 'Prompt',
    fontSize: 20,
    height: 40,
    padding: 5,
    borderRadius: 5,
    backgroundColor: "#fff"
  }
});

export default App;
